    <React.Fragment>
      <div className="container">
        <CurrentLocation />
      </div>
      Developed by{" "}
      <a target="_blank" href="https://www.gauravghai.dev/">
          Gaurav Ghai
      </a>{" "}
    </React.Fragment>
  );
}

export default App;
